import React, { useState } from 'react'
import { Container, Accordion, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css'
import './Agenda.css'
import golf from '../images/background2.jpg'
import ReactCardFlip from 'react-card-flip'




function Agenda() {
  const [isFlipped, setIsFlipped] = useState(false)
  const handleClick = () => {
    setIsFlipped(!isFlipped);
  }
    return (
        <>
        <div style={{ background: `url(${golf})`, backgroundSize: 'cover', backgroundPosition: 'bottom center', width:'100%'}} className='middle'>
        <ReactCardFlip isFlipped={isFlipped} flipDirection="vertical">
        <div style={{backgroundColor: 'crimson', height:'100px', float:'down'}}>
          This is the front of the card.
          <Button onClick={handleClick}>Click to flip</Button>
        </div>

        <div style={{backgroundColor: 'blue', height:'100px'}}>
          This is the back of the card.
          <button onClick={handleClick}>Click to flip</button>
        </div>
      </ReactCardFlip>
      </div>
        </>
    )
}

export default Agenda
